css:
@-moz-document domain("terraform.io") {
body {
  background-color: #272B33;
}

h1,
h2,
h3,
h4,
h5,
h6,
body,
#docs-sidebar ul.nav.docs-sidenav li a,
#docs-sidebar ul.nav.docs-sidenav li a:before {
	color: #abb2c0 !important;
}

pre.highlight code, .highlight .o, .highlight .kp {
        color: #abb2c0;
}

.highlight {
	background-color: #2c323d;
}

pre.highlight {
	border: 1px solid #3e4451;
}
}
